import React from 'react';

const ImagesComponent = ({ images }) => {
    return (
        <div className="images-component">
            {images.map((image, index) => (
                <img key={index} src={image} alt={`Watch image ${index + 1}`} />
            ))}
        </div>
    );
};

export default ImagesComponent;
